import './App.css';

import React, { Component } from 'react'
import Navbar from './components/Navbar';
import News from './components/News';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";


export default class App extends Component {

  render() {
    return (
      <div>
      <Router>
    <Navbar/>

    <Routes>
     <Route exact path="/" element={<News key="generals" pageSize={5} newsKey='6ebc2a61e4214ddebacf3db11107688e' category="general" setCountry="in"/>} >
      </Route>

          <Route exact path="/business" element={<News key="business" pageSize={5} newsKey='6ebc2a61e4214ddebacf3db11107688e' category="business" setCountry="in"/>}>

          </Route>
          <Route exact path="/entertainment" element={<News key="entertainment" pageSize={5} newsKey='6ebc2a61e4214ddebacf3db11107688e' category="entertainment" setCountry="in"/>}>

          </Route>
          <Route  exact path="/health" element={<News key="health" pageSize={5} newsKey='6ebc2a61e4214ddebacf3db11107688e' category="health" setCountry="in"/>}>

          </Route>
          <Route exact path="/science" element={ <News key="science" pageSize={5} newsKey='6ebc2a61e4214ddebacf3db11107688e' category="science" setCountry="in"/>}>

          </Route>
          <Route exact path="/sports" element={<News key="sports" pageSize={5} newsKey='6ebc2a61e4214ddebacf3db11107688e' category="sports" setCountry="in"/>}>

          </Route>
          <Route exact path="/technology" element={<News key="technology" pageSize={5} newsKey='6ebc2a61e4214ddebacf3db11107688e' category="technology" setCountry="in"/>}>

          </Route>

        </Routes>
    </Router>
      </div>
    )
  }
}
